import React, {useState} from 'react';
import Center_item  from './CenterInfo';

function Center_List({items}){
    return(
        <div>
            {
                items.map((center)=>
                    // eslint-disable-next-line react/jsx-pascal-case
                    <Center_item center = {center}/>
                )
            }
        </div>
    );
}
export default Center_List;
